import piczero from '../images/pic0.jpg'
import picone from '../images/pic1.jpg'
import pictwo from '../images/pic2.jpg'


function Card() {
    return (
        <div>
          <img src={piczero} alt='' style={size="20px"}></img>  
          <img src={picone} alt=''></img> 
          <img src={pictwo} alt=''></img> 
        </div>
    );

}

export default Card;
